import React from 'react'
import { useState } from 'react';
import {Link} from 'react-router-dom'
import './Style.css';
import Room from './Room';
import AllRooms from './AllRooms';

export default function HomePage(props) {
  return (
    <div>
      <h1>HomePage</h1>
      <div id='allRooms'>
      {props.arr.map((val,i)=>{
          // return<Room arr={props.add} index={i} roomName={val.roomName} roomType={val.roomType} roomColor={val.roomColor} roomProducts={val.roomProducts}></Room>
          {val.roomName}
          {val.roomType}
         {val.roomColor}
         {val.roomProducts}
        }
        )}


      </div>

      <Link to='/add-room'><button id="plusButton">+</button></Link>
    
    </div>
  )
}
